import avatar from "../assets/avatar.png";
function Greetings() {
  return (
    <div className="flex flex-col-reverse items-center justify-center  md:flex-row font-racing text-darkTone max-w-screen-xl mx-auto p-8">
      <div className="flex flex-col justify-center items-start p-16 gap-2">
        <div className="text-3xl md:text-5xl">Hello, World!</div>
        <div className="text-3xl text-black">I'm Danial Ross.</div>
        <div className="text-5xl">Web Developer.</div>
      </div>
      <div className="">
        <img
          className="bg-lightTone rounded-full"
          src={avatar}
          alt="avatar"
        ></img>
      </div>
    </div>
  );
}

export default Greetings;
